sources.scss/globals/sitefooter.scss:
@use 'colors' as c;
@use '../abstracts/breakpoints' as *;

.sitefooter {
    background-color: c.$dark;
    color: c.$bright;
    padding: 60px 0 60px 30px;
    position: fixed;
    top: var(--SmallHeaderHeight);
    z-index: -1;
    width: 100%;
    box-sizing: border-box;
    .corporate {
        p {
            margin-top: 25px;
        }
    }
    .sitemap {
        margin-top: 60px;
        h3 {
            padding-bottom: 30px;
        }
    }
    li {
        list-style-type: none;
    }
    @include mq(1100px) {
        display: flex;
        padding: 60px;
        position: fixed;
        top: inherit;
        bottom: 0;
        z-index: -1;
        .sitemap {
            margin: 0;
            margin-left: auto;
            &:last-of-type {
                margin-left: 60px;
            }

        }
    }

}

body.footer {
    .sitefooter {
        position: static;
    }
    .sitecontent {
        margin-bottom: 0;
    }
}

sources.scss/main.scss:
@use 'components/buttons';
@use 'components/form';
@use 'globals/typo';
@use 'globals/colors' as c;

@use 'globals/fonts';
@use 'globals/sitefooter';


html {
    scroll-behavior: smooth;
}
body {
    margin: 0;
}
ul {
    margin: 0;
    padding: 0;
}

.sitecontent {
    background-color: c.$bright;
    margin-bottom: var(--SiteFooterHeight);
}
